export default function exportToPDF(credentialArray) {
    const PDF = new jsPDF()

    //title
    // PDF.setFont('DotoRounded')
    PDF.setFontSize(18)
    PDF.text('SAFEPASS', 14, 22)

    //subtitle
    PDF.setFont('helvetica', 'normal')
    PDF.setFontSize(12)
    PDF.setTextColor(100)
    PDF.text('Exported Passwords', 14, 30)

    //table
    const tableColumn = ["Website", "Username", "Password"]
    const tableRows = []

    credentialArray.forEach((password => {
        const passwordArr = [
            password.website,
            password.username,
            password.password
        ]
        tableRows.push(passwordArr)
    }))

    PDF.autoTable({
        head: [tableColumn],
        body: tableRows,
        startY: 40,
        theme: 'striped',
        headStyles: {fillColor: [22, 160, 133]},
        alternateRowStyles: { fillColor: [240, 240, 240] },
        styles: { fontSize: 10 }
    })

    //footer
    const pageCount = PDF.internal.getNumberOfPages();
    for (let i = 1; i <= pageCount; i++) {
        PDF.setPage(i);
        PDF.text(`Page ${i} of ${pageCount}`, PDF.internal.pageSize.width - 20, PDF.internal.pageSize.height - 10);
    }

    //save
    PDF.save('passwords.pdf');
}